import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import MyBoxes from "./MyBoxes";

const UserSettings = ({
    userSettings,
    handleUserSettingsClose,
    currentUser,
}) => {
    return (
        <Modal
            show={userSettings}
            onHide={handleUserSettingsClose}
            backdrop="true"
            fade="true"
            centered="true"
        >
            <Modal.Header closeButton>
                <Modal.Title><h3>My Dates</h3></Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <h5>Username: {currentUser.userName}</h5>
                <h5>City: {currentUser.userLocation}</h5>
                <h5>
                    Delete your account:{" "}
                    <button type="button" className="btn btn-danger btn-sm">
                        delete
                    </button>
                </h5>
                <br />
                <h4>My Boxes</h4>
                <h5>Location:</h5>
                {Object.hasOwn(currentUser, "_id") && (
                    <ul className="allBoxes">
                        <MyBoxes currentUser={currentUser} />
                    </ul>
                )}
            </Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={handleUserSettingsClose}>
                    Cancel
                </Button>
                <Button variant="primary" onClick={handleUserSettingsClose}>
                    Save settings
                </Button>
            </Modal.Footer>
        </Modal>
    );
};

export default UserSettings;
